import { CREATE_POSTS } from '../Actions/types';

const initialState = {
    username: '',
    password: '',
    email: ''
}

export default function (state = initialState, action) {
    switch (action.type) {
        case CREATE_POSTS:
            return {
                ...state,
                username: action.payload,
                password: action.payload,
                email: action.payload
            };
        default:
            return state;
    }
}
